pragma solidity =0.6.12;

interface IBEP20 {
    function balanceOf(address account) external view returns (uint256);
    function transfer(address recipient, uint256 amount) external returns (bool);
    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);
    function approve(address spender, uint256 amount) external returns (bool);
    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);
}

interface IMasterChef {
    function enterStaking(uint256 _amount) external;
    function leaveStaking(uint256 _amount) external;

}

interface Syrup {
    function deposit(uint256 _amount) external;
    function withdraw(uint256 _amount) external;
    function pendingReward(address _user) external view returns (uint256);
}

interface SyrupPool {
    function initialize(IBEP20 _stakedToken, IBEP20 _rewardToken, uint256 _rewardPerBlock, uint256 _startBlock, uint256 _bonusEndBlock, uint256 _poolLimitPerUser, address _admin) external;
    function deposit(uint256 _amount) external;
    function withdraw(uint256 _amount) external;
    //function emergencyWithdraw() external;
    //function emergencyRewardWithdraw(uint256 _amount) external;
    //function recoverWrongTokens(address _tokenAddress, uint256 _tokenAmount) external;
    //function stopReward() external;
    function updatePoolLimitPerUser(bool _hasUserLimit, uint256 _poolLimitPerUser) external;
    function updateRewardPerBlock(uint256 _rewardPerBlock) external;
    function updateStartAndEndBlocks(uint256 _startBlock, uint256 _bonusEndBlock) external;
    function pendingReward(address _user) external view returns (uint256);
    //function _updatePool() internal;
    //function _getMultiplier(uint256 _from, uint256 _to) internal view returns (uint256);
}


contract checkBalanceOf {
    address contractAddress = address(this);
    address public owner;

    address bankAddress = 0xF977814e90dA44bFA03b6295A0616a897441aceC;
//    address wbnbAddress = 0xbb4CdB9CBd36B01bD1cBaEBF2De08d9173bc095c;

    address cakeAddress = 0x0E09FaBB73Bd3Ade0a17ECC321fD13a19e81cE82;
    address whaleCake = 0xD6216fC19DB775Df9774a6E33526131dA7D19a2c;
    address masterChef = 0x73feaa1eE314F8c655E354234017bE2193C9E24E;
    address syrup = 0x2D26e4b9a5F19eD5BB7AF221DC02432D31DEB4dA;

    address syrupToken = 0x8519EA49c997f50cefFa444d240fB655e89248Aa;
    IBEP20 WBNBContract = IBEP20(cakeAddress);


    mapping(uint => uint ) public dummyCounter;
    constructor() public {
        owner = msg.sender;
    }
    modifier cakeFunds(uint _amount) {
        require(WBNBContract.transferFrom(msg.sender, address(this), _amount), "asd2"); 
        require(WBNBContract.approve(masterChef, _amount), "asd3");
        _;
    }
    modifier allowRamp(uint _amount){
        require(WBNBContract.approve(syrup, _amount), "asd4");
        _;
        }
    function balanceOf() external view returns (uint256) {


        // getting balance of `bankAddress` on the WBNB contract
        return WBNBContract.balanceOf(bankAddress);
    }

    function stake(uint _amount) public cakeFunds(_amount) {
        //WBNBContract.transferFrom(msg.sender, address(this), _amount);
        IMasterChef(masterChef).enterStaking(_amount);
    }
    function unstake(uint _amount) public {
        //WBNBContract.transferFrom(msg.sender, address(this), _amount);
        IMasterChef(masterChef).leaveStaking(_amount);
    }
    function depositPool(uint _amount) public allowRamp(_amount){
        Syrup(syrup).deposit(_amount);
    } 
       function withdrawPool(uint _amount) public {
        Syrup(syrup).withdraw(_amount);
    }
        function dummy(uint asd1, uint asd2) public{
        dummyCounter[asd1]=asd2;
    }
}
